import { StyleSheet, Text, View } from 'react-native';
import { colors } from '../../../configuration';
import { normalize } from '../../utils/normalize';

const styles = StyleSheet.create({
    icon:{
        width:normalize(10),
        height:normalize(10)
    },
    container: {
        flex: 1,
        backgroundColor: 'transparent',
        justifyContent: 'flex-end'
      },
    iconContainer: {
        flex: 0.1,
        alignSelf: 'flex-end'
      },
      pictureButton1: { 
        borderWidth: 2,
        borderRadius: normalize(20),
        borderColor: 'white',
        height: 50,
        width:50,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center'},
    pictureButton2: {
        borderWidth: 2,
        borderRadius: normalize(20),
        borderColor: 'white',
        height: 40,
        width:40,
        backgroundColor: 'white'
    },
    camera:{ 
        alignSelf:'center',
        width: normalize(370*9), 
        height: normalize(370*48), 
    },
    mainContainer:{
      backgroundColor: colors.black
    }
  });

export default styles
